export default function ViewDetails() {
  const { studentid } = useParams();
  return (
    <div className="container">
      <h1>Sutdent Details</h1>
      <div className="details">
        <p>
          <strong>ID:</strong>1
        </p>
        <p>
          <strong>Name:</strong>vilasini
        </p>
        <p>
          <strong>Place:</strong>Hyderabd
        </p>
        <p>
          <strong>Phone</strong>9805462315
        </p>
      </div>
    </div>
  );
}
